import React from 'react';
import {Link} from "react-router-dom";
import classes from './Navbar.module.css'

const Navbar = () => {
    return (
        <div className={classes.navbar}>
            <Link to={"/"}>Currencies</Link>
            <Link to={"/converter"}>Converter</Link>
        </div>
    );
};

export default Navbar;
